export default function LeftNav({ data }) {
  return (
    <div className="card-container">
      <div className="col-12 col-sm-8 col-md-6 col-lg-4 d-flex align-items-stretch my-2">
        {data &&
          data.map((item, index) => (
            <div className="cards" key={index}>
              <img className="card-img-top" src="holder.js/100px180" />
              <div className="card-body">
                <div className="card-title h5">Card Title</div>
                <ul>
                  <p className="mission-id card-text">
                    Missions Name: {item.mission_name}
                  </p>
                  <li>
                    <p className="mission-id card-text">
                      List Mission Ids: {item.mission_id}
                    </p>
                  </li>
                </ul>
                <p className="mission-id card-text">Launch Year: </p>
                <p className="mission-id card-text">Successful Launch: </p>
                <p className="mission-id card-text">Successful Landing: </p>
              </div>
            </div>
          ))}
      </div>{' '}
    </div>
  )
}
